import groovy.json.JsonSlurper
import groovy.json.JsonOutput;

// read flow file
def flowFile = session.get()

if(!flowFile) {
  return
}

// read requisition
def requisition = new JsonSlurper().parse(flowFile.read())

// convert line items to measure report groups
def groups = requisition.requisitionLineItems.collect { line ->
  def productCode = line.orderable.productCode
  def maxPeriodsOfStock = line.maxPeriodsOfStock
  def stockOnHand = line.stockOnHand
  def beginningBalance = line.beginningBalance
  def totalConsumedQuantity = line.totalConsumedQuantity
  def totalLossesAndAdjustments = line.totalLossesAndAdjustments
  def totalReceivedQuantity = line.totalReceivedQuantity
  def totalStockoutDays = line.totalStockoutDays
  def stockStatus = "not_found";
  def averageConsumption = line.averageConsumption
  BigInteger monthsOfStock = 0;

  if (averageConsumption != null && stockOnHand != null && averageConsumption != 0) {
    monthsOfStock = Math.round(stockOnHand/averageConsumption);
  } else {
    monthsOfStock = 0;  
  }

  return ["code": ["text": productCode], "measureScore": ["value": monthsOfStock]]
}

// add program group
groups.add([
  "code": [
    "text": "programName"
  ],
  "measureScore": [
    "system": "openlmisProgramName",
    "code": "REGEX_PROGRAM_NAME"
  ]
])

// create report template
def report = [
  "resourceType": "MeasureReport",
  "status": "complete",
  "identifier": [[
    "system": "openlmisRequisitionId",
    "value": "REGEX_REQUISITION_ID"
  ]],
  "type": "summary",
  "measure": "Measure/REGEX_MEASURE_ID",
  "reporter": [
    "reference": "Location/REGEX_LOCATION_RESOURCE"
  ],
  "period": [
    "start": "REGEX_PERIOD_START_DATE",
    "end": "REGEX_PERIOD_END_DATE"
  ],
  "group": groups
]

// save report
flowFile.write("UTF-8", JsonOutput.toJson(report))

session.transfer(flowFile, REL_SUCCESS)

import groovy.json.JsonSlurper
import groovy.json.JsonOutput;

// read flow file
def flowFile = session.get()

if(!flowFile) {
  return
}

// read requisition
def requisition = new JsonSlurper().parse(flowFile.read())

// convert line items to measure report groups
def groups = requisition.requisitionLineItems.collect { line ->
  def productCode = line.orderable.productCode
  def maxPeriodsOfStock = line.maxPeriodsOfStock
  def stockOnHand = line.stockOnHand
  def beginningBalance = line.beginningBalance
  def totalConsumedQuantity = line.totalConsumedQuantity
  def totalLossesAndAdjustments = line.totalLossesAndAdjustments
  def totalReceivedQuantity = line.totalReceivedQuantity
  def totalStockoutDays = line.totalStockoutDays
  def stockStatus = "not_found";

  if (maxPeriodsOfStock > 6) {
    stockStatus = "Overstocked"
  } else if (maxPeriodsOfStock < 3) {
    stockStatus = "Understocked"
  } else if (stockOnHand == 0 || totalStockoutDays == 0 || beginningBalance == 0 || maxPeriodsOfStock == 0) {
    stockStatus = "Stockout"
  } else if (maxPeriodsOfStock >= 6 && maxPeriodsOfStock <= 6) {
    stockStatus = "Adequately Stocked"
  }

  return ["code": ["text": productCode], "measureScore": ["system": "openlmisStockStatus", "code": stockStatus]]
}

// add program group
groups.add([
  "code": [
    "text": "programName"
  ],
  "measureScore": [
    "system": "openlmisProgramName",
    "code": "REGEX_PROGRAM_NAME"
  ]
])

// create report template
def report = [
  "resourceType": "MeasureReport",
  "status": "complete",
  "identifier": [[
    "system": "openlmisRequisitionId",
    "value": "REGEX_REQUISITION_ID"
  ]],
  "type": "summary",
  "measure": "Measure/REGEX_MEASURE_ID",
  "reporter": [
    "reference": "Location/REGEX_LOCATION_RESOURCE"
  ],
  "period": [
    "start": "REGEX_PERIOD_START_DATE",
    "end": "REGEX_PERIOD_END_DATE"
  ],
  "group": groups
]

// save report
flowFile.write("UTF-8", JsonOutput.toJson(report))

session.transfer(flowFile, REL_SUCCESS)
